import React, { useState, useContext } from "react";
import { NavLink, useNavigate } from "react-router-dom";
import { adddata } from "./context/ContextProvider";
import { Button, Typography, Stack, TextField, Select } from '@mui/material';
import Home from "./Home";
// import * as AgGrid from "ag-grid-community";

const statusOptions = [
  {
    value: 'QUEUED',
    label: 'Queued',
  },
  {
    value: 'IN-PROGRESS',
    label: 'In Progress',
  },
  {
    value: 'SUCCESS',
    label: 'Success',
  },
  {
    value: 'FAILURE',
    label: 'Failure',
  },
];

const Register = () => {
  const { udata, setUdata } = useContext(adddata);

  const navigate = useNavigate("");

  const [inpval, setINP] = useState({
    status: "",
    name: "",
    queued: "",
    scanning: "",
    finished: "",
    type: "",
    rule: "",
    path: "",
    pos: "",
    desc: "",
    severity: "",
  });

  const setdata = (e) => {
    console.log(e.target.value);
    const { name, value } = e.target;
    setINP((preval) => {
      return {
        ...preval,
        [name]: value,
      };
    });
  };

  //Sending data from frontend->backend via fetch api
  const addInpData = async (e) => {
    e.preventDefault();

    const {
      status,
      name,
      queued,
      scanning,
      finished,
      type,
      rule,
      path,
      pos,
      desc,
      severity,
    } = inpval;

    const res = await fetch("/register", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        status,
        name,
        queued,
        scanning,
        finished,
        type,
        rule,
        path,
        pos,
        desc,
        severity,
      }),
    });

    const data = await res.json();
    console.log(data);

    if (res.status === 422 || !data) {
      alert("Error");
      console.log("Error");
    } else {
      navigate("/");
      setUdata(data);
      console.log("Data has been added");
    }
  };

  return (
    <div className="container">
      <div className="add_btn mt-2 mb-2">
        <Typography variant="h5">Add New Scan
        &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;
        &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;
        &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;
        &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;
        <a href='./'>
          <Button variant="outlined" sx={{height: 50, width: 195}} onClick={() => ""} alignItems="right">
            <Stack direction="row" alignItems="center" justifyContent={"center"}>
              <Typography><span style={{ fontWeight: 'bold' }}>GO TO DASHBOARD</span></Typography>
            </Stack>
          </Button>
          </a>
          </Typography>
        </div>
      {/* <form className="mt-5"> */}
        <div className="column">
          <div className="row">
            <TextField label="Repository Name"  name="repository_name" /> 
            {/* className="form-label">
              <b>Repository Name</b>
            </label> */}
            {/* <input
              type="text"
              value={inpval.name}
              onChange={setdata}
              name="name"
              className="form-control"
            /> */}
          </div>

          <div className="row">
          <Select label="Status" name="status" options={statusOptions} />
            {/* <br />
            <select
              name="status"
              value={inpval.status}
              onChange={setdata}
            >
              <option value="" disabled selected hidden>
                Choose An Option
              </option>
              <option value="Queued">Queued</option>
              <option value="In Progress">In Progress</option>
              <option value="Success">Success</option>
              <option value="Failed">Failed</option>
            </select> */}
          </div>

          <div className="mb-3 col-lg-6 col-md-6 col-12">
            <label className="form-label">
              <b>Queued At</b>
            </label>
            <input
              type="datetime-local"
              value={inpval.queued}
              onChange={setdata}
              name="queued"
              className="form-control"
            />
          </div>
          <div className="mb-3 col-lg-6 col-md-6 col-12">
            <label className="form-label">
              <b>Scanning At</b>
            </label>
            <input
              type="datetime-local"
              value={inpval.scanning}
              onChange={setdata}
              name="scanning"
              className="form-control"
            />
          </div>
          <div className="mb-3 col-lg-6 col-md-6 col-12">
            <label className="form-label">
              <b>Finished At</b>
            </label>
            <input
              type="datetime-local"
              value={inpval.finished}
              onChange={setdata}
              name="finished"
              className="form-control"
            />
          </div>

          <div className="mb-3 col-lg-6 col-md-6 col-12">
            <label className="form-label">
              <b>Type</b>
            </label>
            <input
              type="text"
              value={inpval.type}
              onChange={setdata}
              name="type"
              className="form-control"
            />
          </div>
          <div className="mb-3 col-lg-6 col-md-6 col-12">
            <label className="form-label">
              <b>Rule ID</b>
            </label>
            <input
              type="text"
              value={inpval.rule}
              onChange={setdata}
              name="rule"
              className="form-control"
            />
          </div>
          <div className="mb-3 col-lg-6 col-md-6 col-12">
            <label className="form-label">
              <b>Path</b>
            </label>
            <input
              type="text"
              value={inpval.path}
              onChange={setdata}
              name="path"
              className="form-control"
            />
          </div>
          <div className="mb-3 col-lg-6 col-md-6 col-12">
            <label className="form-label">
              <b>Position</b>
            </label>
            <input
              type="text"
              value={inpval.pos}
              onChange={setdata}
              name="pos"
              className="form-control"
            />
          </div>
          <div className="mb-3 col-lg-6 col-md-6 col-12">
            <label className="form-label">
              <b>Description</b>
            </label>
            <input
              type="text"
              value={inpval.desc}
              onChange={setdata}
              name="desc"
              className="form-control"
            />
          </div>
          <div className="mb-3 col-lg-6 col-md-6 col-12">
            <label className="form-label">
              <b>Severity</b>
            </label>
            <input
              type="text"
              value={inpval.severity}
              onChange={setdata}
              name="severity"
              className="form-control"
            />
          </div>

          <Button variant="outlined" sx={{height: 50, width: 230}} onClick={() => addInpData()} alignItems="right" >
            <Stack direction="row" alignItems="center" justifyContent={"center"}>
              <Typography><span style={{ fontWeight: 'bold' }}>Submit</span></Typography>
            </Stack>
          </Button>
        </div>
      {/* </form> */}
    </div>
  );
};

export default Register;
